import React from 'react'
import {Link} from 'react-router-dom';
// set image to the left and text to the right

const Intro = () => {
  return (
    <div className="intro-section">

        <div className="intro-image">
            <img src="https://images.unsplash.com/photo-1610092018883-8b1b2e1b1b1a?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1050&q=80" alt="intro" />
        </div>
        <div className="intro-text">
            <h1>Hi, I'm Inga.</h1>
            <p>I'm a software engineer based in New York City. I'm passionate about building products that make a difference in people's lives.</p>
        </div>
    </div>
  )
}

export default Intro;
